import { Link } from "react-router-dom";

export default function Header() {
  return (
    <header className="header">
      <h2>Storefront.</h2>
      <input type="text" placeholder="Search products..." />
      <nav>
        <Link to="/login">Login</Link>
        <Link to="/cart">Cart</Link>
      </nav>
    </header>
  );
}
